import matplotlib.pyplot as plt
import numpy as np
from scipy import ndimage

image = plt.imread(r'/content/Bacteria.jpg')
# puisque la dimension de l'image est (665, 725, 3) on va le rendre en 2D
image=image[:,:,0]
plt.imshow(image,cmap='gray')
image.shape

image_2 = np.copy(image)
plt.hist(image_2.ravel(),bins=255) #image 8 bits -> 2^8=255
plt.show()

"""le role du *np.ravel()*

![image_2022-03-30_200809.png](data:image/png;base64,)
"""

# Separer les bacteries de l'arriere plan
image=image<150
image
plt.imshow(image)

# Effacer le bruit (les peties details)
open_x=ndimage.binary_opening(image)
plt.imshow(open_x)

label_image,n_labels=ndimage.label(open_x)
n_labels

plt.imshow(label_image)

"""![image_2022-03-30_202647.png](data:image/png;base64,)"""

# la taille de chaque bacterie
sizes = ndimage.sum(open_x,label_image,range(n_labels))
sizes

plt.scatter(range(n_labels),sizes,c='red')